import React from 'react';
import Homework from "./Homework";
const TimeTable=()=>{
    return(
        <div className="time-table-container">
            <div className="days">
                <p>MON</p>
                <p>TUE</p>
                <p>WED</p>
                <p>THU</p>
                <p>FRI</p>
                <p>SAT</p>
                <p>SUN</p>
            </div>
            <div className="Mon">
                <Homework />

            </div>
        </div>
    )

}
export default TimeTable;
